window.bookSummaryJSON = "<p><b>Is this captivity...or a second chance?</b><br> <br> My men and I lost our bid for freedom. But nothing in our new prison is quite what I expected.<br> <br> That doesn't mean I'm going to stop fighting. I just have to make sure I pick the right battles. Especially when it isn't just our lives but those of the kids who came after us on the line.<br> <br> If I'm going to be more than a monster, I need to figure out who the real monsters are—and take back everything they've stolen from us before it's too late.</p>"; 
